webpackJsonp([0x9174d522b7ad],{5140:function(e,t){e.exports={data:{post:{html:"<p>A big load off my shoulders today... the new company website is online, nearly two months late and just two working days before we fly to the US! I would have preferred that it be up running for a month before skipping off, but 48 hours is a good burn-in time, right?</p>\n<p>In the meantime, Mama's done the lion's share of planning and preparation for our trip. We've done plenty o trips between Europe and the US, but adding Christopher to the equation will make things roughly twice as complicated, I'm guessing.</p>\n<p>We fly first to Phoenix for a week, then to Minnesota for 2 weeks. We'll be visiting friends and family... no time to play tourist!</p>",fields:{title:"Relief!",date:"23 Sep 2000",url:"https://papascott.de/2000-09-23-relief/"}}},pathContext:{slug:"/2000-09-23-relief/",prev:{fields:{title:"Olympic Shootout",date:"17 Sep 2000",slug:"/2000-09-17-olympic-shootout/"}},next:{fields:{title:"Behind the Curtain",date:"24 Sep 2000",slug:"/2000-09-24-behind-the-curtain/"}}}}}});
